import { useSelector } from 'react-redux';
import { findStatus } from '../../../redux/statusRedux';
import styles from './SummaryCard.module.scss'

export const SummaryCard = props => {
    const match = props.match;
    const status = useSelector(state => findStatus(status))
    console.log(status)
    return (
        <section className={styles.box}>
            <h2>Kolejka: {match.round} - {match.guest}</h2>
            <div>
                <p>Wiktor obecny </p>
                <p>Mateusz nieobecny</p>
                <p>Piotrek nie wiem</p>
                <p>Marcin obecny</p>
                <p>Dawid obecny</p>
                <p>Dawid nieobecny</p>
            </div>
        </section>
    )
}
